script: |
  super -f text -I q2695.spq | sort > q2695.out

inputs:
  - name: q2695.spq
    data: |
      SELECT DISTINCT 23 * + 10 + cor1.col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q2695.out
    data: |
      256
      257
      268
